import React, { useEffect, useState } from 'react'
import axios from 'axios';

const Stats = () => {

    var test_data = {
        "playlist_link": "https://open.spotify.com/playlist/0XipLi1tlMf0Ey0p1TKnLi?si=53512ab488414b26",
        "access_token": "BQC0A4_D5EnxagwM9rmZI1siV4fELSiv31sQl4INMhgO-obqCDSNuhW5GHp877v2gb6JPRxv3Po3sSlKvbuYeXY_08-I7B5thCBQ7cm0X0mWcdJkdW4"
    }

    var top_artists = [];

    const [data, setData] = useState(null);
    const [error, setError] = useState("");
    const [loaded, setLoaded] = useState(false);

    useEffect(() => {
        axios
          .post("http://localhost:8000/playlist_get_info/", test_data)
          .then((response) => setData(response.data))
          .catch((error) => setError(error.message))
          .finally(() => setLoaded(true));
    }, []);

    // Enquanto está carregando
    if (loaded === false){
        return "Carregando..."
    } else{

        // Com erro
        if (error){
            return error
        }

        if (data != null){
            const arr = Object.entries(data);
            top_artists = arr[0][1]
            console.log(top_artists)

        }

        // nome - app - % 

        // Sem erro
        return (
            <div>
                <h1>Top Artists</h1>
            </div>
        )
    }
}

export default Stats
